        public IList<IList<int>> UpdateMatrix(IList<IList<int>> matrix)
        {
            if (matrix == null || matrix.Count == 0) return matrix;
            var result = new List<IList<int>>(matrix.Count);

            // Init the result for non-zero elements to IntMAx
            for (var i=0;i<matrix.Count;i++)
            {
                result.Add(new List<int>(matrix[i].Count));
                for (var j=0;j<matrix[i].Count;j++)
                {
                    if (matrix[i][j] != 0)
                    {
                        result[i].Add(Int32.MaxValue);
                    }
                    else
                    {
                        result[i].Add(0);
                    }
                }
            }
            
            for (var i = 0; i < matrix.Count; i++)
            {
                for (var j = 0; j < matrix[i].Count; j++)
                {
                    if (matrix[i][j] != 0)
                    {
                        DFS(matrix, result, i, j);
                    }
                }
            }

            return result;
        }

