        private void DFS(IList<IList<int>> matrix, IList<IList<int>> result, int row, int col)
        {
            int[][] dirs = { new int[] { -1, 0 }, new int[] { 1, 0 }, new int[] { 0, -1 }, new int[] { 0, 1 } };

            for (var i = 0; i < dirs.Length; i++)
            {
                int x = row + dirs[i][0];
                int y = col + dirs[i][1];

                if (x < 0 || x >= matrix.Count || y < 0 || y >= matrix[row].Count) continue;

                if (result[x][y] == Int32.MaxValue)
                {
                    result[x][y] = Int32.MaxValue - 1;
                    DFS(matrix, result, x, y);
                }
                result[row][col] = Math.Min(result[row][col], result[x][y] + 1);
            }
        }

        private void Print(IList<IList<int>> matrix)
        {
            Console.WriteLine(
                string.Join(Environment.NewLine,
                    matrix.Select(list => string.Join(", ", list))));
        }
